/*Table structure for table `gjk_hardwarelib_chip` */

DROP TABLE IF EXISTS `gjk_hardwarelib_chip`;

CREATE TABLE `gjk_hardwarelib_chip` (
  `id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT 'ID',
  `chip_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '芯片名称',
  `sn` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'SN',
  `chip_id` varchar(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '顺序号',
  `ip_confige` varchar(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'IP',
  `hr_type_name` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '硬件类型名称',
  `user_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户',
  `create_time` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建时间',
  `update_time` char(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '修改时间',
  `description` char(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '描述',
  `del_flag` char(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '删除标志',
  `core_num` decimal(5,0) DEFAULT NULL COMMENT '内核数量',
  `mem_size` decimal(10,0) DEFAULT NULL COMMENT '内存大小',
  `node_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '节点ID',
  `chip_data` json DEFAULT NULL COMMENT '芯片数据',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC COMMENT='芯片表';

