/*Table structure for table `gjk_platform` */

DROP TABLE IF EXISTS `gjk_platform`;

CREATE TABLE `gjk_platform` (
  `platform_id` varchar(64) NOT NULL COMMENT '平台ID',
  `name` varchar(32) NOT NULL COMMENT '平台名称',
  `permission` varchar(32) DEFAULT NULL COMMENT '平台权限标识',
  `parent_id` varchar(64) DEFAULT NULL COMMENT '父平台ID',
  `sort` int(11) DEFAULT '1' COMMENT '排序值',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `del_flag` char(1) DEFAULT '0' COMMENT '逻辑删除标记(0--正常 1--删除)',
  PRIMARY KEY (`platform_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='菜单权限表';

