/*Table structure for table `gjk_project` */

DROP TABLE IF EXISTS `gjk_project`;

CREATE TABLE `gjk_project` (
  `id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '项目编号',
  `project_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL,
  `user_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL,
  `project_img` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '项目图标',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `default_software_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '项目默认对应软件框架',
  `default_bsp_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '项目默认对应bsp',
  `description` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8mb4_bin DEFAULT '0' COMMENT '0-正常，1-删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC;

