  `id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT 'id',
  `comp_id` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '构件编号',
  `project_id` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '项目编号',
  `can_use` varchar(1) COLLATE utf8mb4_bin NOT NULL DEFAULT '1' COMMENT '是否可用',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC;

