  `project_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '项目编号',
  `file_name` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL,
  `file_type` varchar(3) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '1、文件夹；2、c文件；3、h文件；4、doc文件;5、待扩展',
  `file_path` varchar(300) COLLATE utf8mb4_bin DEFAULT NULL,
  `parent_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL,
  `json_path` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '流程文件加载路径',
  `software_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '流程所选软件框架',
  `bsp_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '流程所选bsp',
  `newfile_path` varchar(300) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '调用接口新生成xml文件',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC;

