CREATE TABLE `gjk_software` (
  `id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '主键id',
  `software_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '软件框架库名字',
  `version` double(64,1) DEFAULT NULL COMMENT '版本',
  `file_path` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '文件路径',
  `apply_state` varchar(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '审批状态0：未审批，1：已审批',
  `apply_desc` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '审批描述',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `description` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '描述',
  `del_flag` char(1) COLLATE utf8mb4_bin DEFAULT '0' COMMENT '删除标识0-正常，1-删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC;

